def a(n, adict={0:0, 1:0, 2:0, 3:1, 4:3}):
    if n in adict:
        return adict[n]
    adict[n]=3*a(n-1) - a(n-2) - a(n-3) - a(n-4) - 2*a(n-5)
    return adict[n] # _David Nacin_, Mar 07 2012

